var str = result;
var regex1 = new RegExp(/.*\//);
var regex2 = new RegExp(/.{4}$/);
var result1 = str.match(regex1);
var result2 = str.match(regex2);
(function getImgList() {
  var piclist = new Array();
  for (var i = 1; i <= @get:{pages}; i++) {
    var s = result1 + i + result2;
    piclist[i] = s;
  }
  return piclist;
}()).map(url => '<img src="'+url+'">').join("\n")

